import 'package:flutter/material.dart';

class GalleryScreen extends StatelessWidget {
  const GalleryScreen({super.key});

  @override
  Widget build(BuildContext context) {
    final galleryImages = [
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS40rhUTKssZ73subZYxs-l_UaqwMvqiDXVNQ&s',
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTuBRkhQ2NHbU_MngqbiHibtD7ckyBN44zyCw&s',
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSMFm_193GaeV_kdTi0RTvbo7S5Hh0E-XDlnw&s',
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQcxozkNkvg3zViGHufBTYjq9ym2HBqeEJ3AA&s',
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSC1chx4_rBeWRUc_VEpfhjVssw86LwH1p2xQ&s',
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR8sdJmAcWbByVM8RikQvNPE40QFv1yUi07tg&s',
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSOAcDrp_7LQ3JwJsh3cfc7cejxdZMEU6GThA&s',
    ];

    return Scaffold(
      appBar: AppBar(
        title: const Text('Eco Gallery'),
      ),
      body: Padding(
        padding: const EdgeInsets.all(8.0),
        child: GridView.builder(
          gridDelegate: const SliverGridDelegateWithFixedCrossAxisCount(
            crossAxisCount: 2,
            crossAxisSpacing: 8,
            mainAxisSpacing: 8,
          ),
          itemCount: galleryImages.length,
          itemBuilder: (context, index) {
            final imageUrl = galleryImages[index];
            return GestureDetector(
              onTap: () {
                Navigator.push(
                  context,
                  MaterialPageRoute(
                    builder: (_) => FullImageView(imageUrl: imageUrl),
                  ),
                );
              },
              child: Hero(
                tag: imageUrl,
                child: ClipRRect(
                  borderRadius: BorderRadius.circular(12),
                  child: Image.network(
                    imageUrl,
                    fit: BoxFit.cover,
                  ),
                ),
              ),
            );
          },
        ),
      ),
    );
  }
}

class FullImageView extends StatelessWidget {
  final String imageUrl;

  const FullImageView({super.key, required this.imageUrl});

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      backgroundColor: Colors.black,
      appBar: AppBar(
        backgroundColor: Colors.transparent,
        title: const Text('View Image'),
      ),
      body: Center(
        child: Hero(
          tag: imageUrl,
          child: InteractiveViewer(
            child: Image.network(imageUrl),
          ),
        ),
      ),
    );
  }
}
